import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Open the mobile menu modal by clicking the "All" button
    // Using a combination of class and text to locate the element
    const menuButton = page.locator('.nav-menu', { hasText: 'All' }).first();
    await menuButton.waitFor({ state: 'visible', timeout: 5000 });
    await menuButton.click();

    // 2. Verify the modal is visible
    const modalOverlay = page.locator('#mobileMenuOverlay');
    await modalOverlay.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    const isModalVisibleBefore = await modalOverlay.isVisible();

    // 3. Press the Escape key to close the modal
    await page.keyboard.press('Escape');

    // 4. Verify the modal is now hidden
    await modalOverlay.waitFor({ state: 'hidden', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    const isModalVisibleAfter = await modalOverlay.isVisible();

    return {
      success: true,
      action: "Closed the mobile menu modal using the Escape key.",
      extractedData: {
        modalVisibleBeforeEscape: isModalVisibleBefore,
        modalVisibleAfterEscape: isModalVisibleAfter
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to close modal with Escape key.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
